This photo is worth a zillion of words.

I know these three amazing bros since the first MV of pandangan pertama launched on TV by around 2008.
My middle school year were pretty amazing with the influence of these three, from the styles, and specially their music - which has become my greatest addiction - always on repeat everywhere I go and also become one of my PDKT song back at the time lol

I have everything - from their CDs and cassettes everytime they have new album, and even some unofficial merch such clothes to established 'RANers' to myself.

Moving forward to my college year, I finally fortunate enough to have a chance meet them on stage by 2014 at Mal Alsut with helped by my friend Jonathan Sutjiono, although the photo get a bit blurry and Rayi's face wasn't full enough to get üòÇ

Si anak kalimantan ini pun berhasil crossed off bucket listnya. Sejauh ini, senang sekali rasanya bisa menjadi bagian dari perjalanan 10 tahun RAN di industri musik Indonesia. 
Tetap hasilkan karya terbaik seiring dengan transformasi bermusik kalian yang semakin matang dan dewasa!

Sukses Asia Music Festival 2017 di Jepang daaaan... Jangan lupa bawa #OlehOlehRANdariJepang buat si anak Kalimantan ini ya!

